import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import "bootstrap/dist/js/bootstrap.bundle.min";
import "./App.css";
import img1 from "./img/Amul Bread.png";
// import img2 from "./img/Amul Butter.jpeg";
// import img3 from "./img/Amul Cheese.jpeg";
// import img4 from "./img/Amul Combo.png";
// import img5 from "./img/Amul Milk .jpeg";
// import img6 from "./img/Kissan Jam.jpeg";
// import productCard from "./ProductCard.jsx";

class productCard{

  render(){
    return(
    <div className="col">
          <div className="card">
            <img src={img1} class="card-img-top" alt="..." />
            <div class="card-body">
              <h5 class="card-title">Amul Sandwich Bread</h5>
              <p class="card-text">Rs.30</p>
              <a href="./" class="btn btn-primary">
                Add to Cart
              </a>
            </div>
          </div>
        </div>
    );
  }

}

function Homee(){


  return (
    <div className="homediv d-flex flex-row">
      <div className="row">
      <productCard />
        <h1>Hello</h1>
      </div>
    </div>
    );
}

export default Homee;
